import styled from "styled-components";
import MainSecTitleCTA from './MainSecTitleCTA'
import MainSecVideoCTA from './MainSecVideoCTA'
import { MainSecButtonCTA } from "./MainSecButtonCTA";
import { GlobalSection } from "../../stylesGlobal";

GlobalSection = styled(GlobalSection)`
    flex-direction: row;
`


const SectionCTA = styled.section`
    width: 100%;
    margin: 0 auto;
    display: flex;
    align-items: center;
    justify-content: center;
    
`

function Section02() {
    return (
        <SectionCTA>
            <MainSecTitleCTA />
            <MainSecVideoCTA />
            <MainSecButtonCTA />
        </SectionCTA>
    )
}

export default Section02
